        private void Form1_KeyDown(object sender, KeyEventArgs e)
        {
            if(e.KeyCode==Keys.Right)
            {
                direction.X = 1;
                direction.Y = 0;
                Debug.WriteLine(direction.X + "," + direction.Y);
            }
            else if (e.KeyCode == Keys.Left)
            {
                direction.X = -1;
                direction.Y = 0;
                Debug.WriteLine(direction.X + "," + direction.Y);
            }
            else if (e.KeyCode == Keys.Up)
            {
                direction.X = 0;
                direction.Y = -1;
                Debug.WriteLine(direction.X+","+direction.Y);
            }
            else if (e.KeyCode == Keys.Down )
            {
                direction.X = 0;
                direction.Y = 1;
                Debug.WriteLine(direction.X + "," + direction.Y);
            }
        }
    }
